import React from "react";
import Main from "./Main";
import { Switch, Route } from "react-router-dom";
import Profile from "./profile/Profile";
import Address from "./profile/account/Address";
import Details from "./profile/account/Details";
import ResetPassword from "./profile/account/ResetPassword";
import Orders from "./profile/tstore/Orders";
import WishList from "./profile/tstore/WishList";


const Home = (props) => {
  return (
      <div className="">
        <Switch>
          <Route path="/account/*" component={Profile} />
          <Route exact path="/account/details" component={Details}/>
                    <Route exact path="/account/address" component={Address}/>
                    <Route exact path="/account/resetpassword" component={ResetPassword}/>
                    <Route exact path="/account/orders" component={Orders}/>
                    <Route exact path="/account/wishlist" component={WishList}/>
          <Route path="" component={Main} />
        </Switch>
      </div>
  );
};

export default Home;
